INSERT INTO `books` VALUES (6,'Classroom of the Elite (Manga) Vol. 3','Syougo Kinugasa, Yuyu Ichino','Seven Seas Entertainment','2022-08-16','Students of the prestigious Tokyo Metropolitan Advanced Nurturing High School are given remarkable freedom--if they can win, barter, or save enough points to work their way up the ranks! After getting in a fight with students from Class C, Sudou is on the verge of expulsion. Ayanokouji and Horikita may have found a witness in Class D\'s Sakura, but she\'s reluctant to make waves and get involved. And even if she did, would anyone trust the word of a Class D student? Meanwhile, Ayanokouji and the others discover additional ways to earn points outside of test scores. But will it be enough to buy their way out of Class D? Or is the system truly rigged against them?','1685798144','9781685798147',0,'Comics & Graphic Novels',3.00,158,'http://books.google.com/books/content?id=f7Z9EAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(7,'Classroom of the Elite (Light Novel) Vol. 1','Syougo Kinugasa','Seven Seas Entertainment','2019-02-07','\'\"Students of the prestigious Tokyo Metropolitan Advanced Nurturing High School are given remarkable freedom--if they can win, barter, or save enough points to work their way up the ranks! Ayanokoji Kiyotaka has landed at the bottom in the scorned Class D, where he meets Horikita Suzune, who\'\'s determined to rise up the ladder to Class A. Can they beat the system in a school where cutthroat competition is the name of the game? \"\'','1645051544','9781645051541',0,'Young Adult Fiction',3.00,312,'http://books.google.com/books/content?id=XdqEDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(8,'Classroom of the Elite (Light Novel) Vol. 4','Syougo Kinugasa','Seven Seas Entertainment','2019-11-21','The second half of the special summer test finds the students duking it out aboard a luxurious cruise ship. Divided into twelve groups patterned after the signs of the Zodiac, all four classes are faced with a devilishly difficult test of their thinking skills. They may have survived the island, but they\'re not out of hot water yet!','1645051579','9781645051572',0,'Young Adult Fiction',0.00,308,'http://books.google.com/books/content?id=jNSyDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(9,'Classroom of the Elite (Manga) Vol. 8','Syougo Kinugasa, Yuyu Ichino','Seven Seas Entertainment','2023-11-07','Students of the prestigious Tokyo Metropolitan Advanced Nurturing High School are given remarkable freedom--if they can win, barter, or save enough points to work their way up the ranks! Class D barely got to celebrate their win on the island before they were given another special test, with way more points at stake. The catch is, they have to work together with the other classes. No small feat considering Class D can barely cooperate with each other. They\'ve also made an enemy of Class C, and Ryuuen is cooking up a new plot to topple Ayanokouji and Horikita. Can they outmaneuver him, or have they met their match?',NULL,'9798891603226',0,'Comics & Graphic Novels',0.00,166,'http://books.google.com/books/content?id=QyPcEAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(10,'Classroom of the Elite (Light Novel) Vol. 7','Syougo Kinugasa','Seven Seas Entertainment','2020-10-22','The end of the second semester is near, and Ryuuen\'s manhunt for Class D\'s mastermind is only getting more aggressive. When he and his goons decide to torture an answer out of Karuizawa, Ayanokouji decides it\'s finally time to step forward--if, that is, Karuizawa doesn\'t break under the pressure first!','1645053938','9781645053934',0,'Young Adult Fiction',0.00,248,'http://books.google.com/books/content?id=VND9DwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(11,'Classroom of the Elite: Year 2 (Light Novel) Vol. 5','Syougo Kinugasa, Tomoseshunsaku','Seven Seas Entertainment','2023-05-18','As the second semester begins, two additional events are announced: the school\'s sports festival and its first-ever cultural festival! But before these two can kick off, an unexpected special exam will be held. The rules seem simple, but the questions might be heavier than anyone expects... Are the students truly ready to cast their final votes?',NULL,'9798888437391',0,'Comics & Graphic Novels',0.00,366,'http://books.google.com/books/content?id=7gu6EAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(18,'Classroom of the Elite','Syougo Kinugasa, Tomoseshunsaku','Không có nhà xuất bản','2022','Không có mô tả',NULL,NULL,0,'Không có thể loại',0.00,0,'https://via.placeholder.com/150','en','NOT_MATURE','BOOK'),(19,'Classroom of the Elite: Year 2 (Light Novel) Vol. 6','Syougo Kinugasa, Tomoseshunsaku','Seven Seas Entertainment','2023-06-15','The results of the Unanimous Special Exam weigh heavily on Ayanokouji\'s class. Kushida, Hasebe, and Wang haven\'t come to school in days. But time marches on, and when details of the Sports Festival are announced, Horikata\'s opponents disrupt the planning meeting. The class is now behind before the games can even begin! Can everyone live with the choices they\'ve made and come out on top?',NULL,'9798888438343',0,'Comics & Graphic Novels',0.00,366,'http://books.google.com/books/content?id=Ic6_EAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(20,'Classroom of the Elite (Light Novel) Vol. 10','Syougo Kinugasa, Tomoseshunsaku','Seven Seas Entertainment','2022-02-17','It\'s spring, and for the first time in the school\'s history, no one has been expelled after the third semester exams. As a result, the Advanced Nurturing High School sets a cruel test--each class must choose one of their own members to be expelled. Chaos consumes the first-years as Hirata tries and fails to keep the class from turning on each other, Ichinose strikes a costly bargain with Nagumo, and Ryuuen\'s classmates seem ready to throw him to the wolves. Can Class C make it out of this unscathed--or will they be undone by traitors within?','1648279775','9781648279775',0,'Young Adult Fiction',0.00,325,'http://books.google.com/books/content?id=yIFeEAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(21,'Classroom of the Elite: Year 2 (Light Novel) Vol. 2','Syougo Kinugasa, Tomoseshunsaku','Seven Seas Entertainment','2022-07-21','Ayanokouji\'s relationship with Karuizawa deepens, while the aftershock of his perfect mathematics score ripples through the school. Horikita asks to join the student council, and is accepted by Nagumo. And summer vacation brings with it no rest, but another special exam--a reprise of the earlier deserted island test. Except this time, it\'ll be a battle royale with all three grade levels duking it out against each other!','1685794483','9781685794484',0,'Comics & Graphic Novels',0.00,379,'http://books.google.com/books/content?id=qmh3EAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(53,'Wor(l)d Religions','Daniel Deleanu','iUniverse','2003-12-16','Daniel Deleanu continues in Wor(l)d Religions the logosophistic adventure started in Principles of Logosophism, The Logoarchetype and Logosophistic Investigations. Unlike the other three books from the logosophistic series, Wor(l)d Religions appeals to a wider array of readers. Daniel Deleanu chooses a rational methodology, namely that exposed by Immanuel Kant in his essay Fundamental Principals of the Metaphysic of Morals. By this approach, the creator of logosophism does not intend to reduce the study of religion to a strict framework of empirical determinism, but, on the contrary, he wishes to prove that the analytical study religion should have all the attributes of science. By eliminating most of the subjective properties of world religions, which are due to the nature of the observer rather than the religions themselves, the author traces a common path of all major beliefs, leading to the most important archetype of humankind, the Word (the logoarchetype), which is associated with the Divinity in every spiritual tradition.','1469784246','9781469784243',0,'Religion',0.00,121,'http://books.google.com/books/content?id=JHenBAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(55,'A Theory of Semiotics','Umberto Eco','Indiana University Press','1979','\" . . . the greatest contribution to [semiotics] since the pioneering work of C. S. Peirce and Charles Morris.\" —Journal of Aesthetics and Art Criticism \" . . . draws on philosophy, linguistics, sociology, anthropology and aesthetics and refers to a wide range of scholarship . . . raises many fascinating questions.\" —Language in Society \" . . . a major contribution to the field of semiotic studies.\" —Robert Scholes, Journal of Aesthetics and Art Criticism \" . . . the most significant text on the subject published in the English language that I know of.\" —Arthur Asa Berger, Journal of Communication Eco\'s treatment demonstrates his mastery of the field of semiotics. It focuses on the twin problems of the doctrine of signs—communication and signification—and offers a highly original theory of sign production, including a carefully wrought typology of signs and modes of production.','0253202175','9780253202178',3,'Language Arts & Disciplines',4.50,372,'http://books.google.com/books/content?id=BoXO4ItsuaMC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(56,'Legal Education and the Reproduction of Hierarchy','Duncan Kennedy','NYU Press','2004-07-01','In 1983 Harvard law professor Duncan Kennedy self-published a biting critique of the law school system called Legal Education and the Reproduction of Hierarchy. This controversial booklet was reviewed in several major law journals—unprecedented for a self-published work—and influenced a generation of law students and teachers. In this well-known critique, Duncan Kennedy argues that legal education reinforces class, race, and gender inequality in our society. However, Kennedy proposes a radical egalitarian alternative vision of what legal education should become, and a strategy, starting from the anarchist idea of workplace organizing, for struggle in that direction. Legal Education and the Reproduction of Hierarchy is comprehensive, covering everything about law school from the first day to moot court to job placement to life after law school. Kennedy\'s book remains one of the most cited works on American legal education. The visually striking original text is reprinted here, making it available to a new generation. The text is buttressed by commentaries by five prominent legal scholars who consider its meaning for today, as well as by an introduction and afterword by the author that describes the context in which Kennedy wrote the book, including a brief history of critical legal studies.','0814748228','9780814748220',0,'Law',0.00,231,'http://books.google.com/books/content?id=gDehBwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(59,'A Concise History of Greece','Richard Clogg','Cambridge University Press','2002-06-20','This book provides a concise, illustrated introduction to the history of modern Greece, with a new final chapter about Greek history and politics to the present day. 56 illustrations. 10 maps.','0521004799','9780521004794',4,'History',3.00,316,'http://books.google.com/books/content?id=H5pyUIY4THYC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(60,'Damascus','Ross Burns','Psychology Press','2005','Lavishly illustrated, the first book in English to relate the history of Damascus, is a compelling and unique exploration of a fascinating city.','0415271053','9780415271059',0,'Damascus (Syria)',0.00,409,'http://books.google.com/books/content?id=SVR2cjWptCAC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(61,'Images of Nebuchadnezzar','Ronald Herbert Sack','Susquehanna University Press','2004','Images of Nebuchadnezzar attempts to probe the diversity of cultural attitudes reflected in the characterizations of this famous king through an examination of both the original cuneiform sources as well as the accounts of chronographers written in Greek, Roman, and medieval times. Included in this revised and expanded second edition are two new chapters that examine both Nebuchadnezzar\'s administrative policies and the impact that his death had on both contemporary and later cultures. Both the positive and negative images of the king are explored, with conclusions being developed as to what the authors of the various surviving accounts actually thought the king really was. In the process, the whole nature of historiography in the ancient world is analyzed, and a number of broad conclusions are developed. Anyone who has ever read Second Kings or the books of Daniel and Jeremiah of the Old Testament is familiar with the name of Nebuchadnezzar, the king of Babylon who conquered the kingdom of Judah and destroyed Solomon\'s temple. As the second member of the Chaldean dynasty of Mesopotamia (626-539 B.C.), he ruled for forty-three years (605-562 B.C.), during which time he also led military campaigns into Syria and Lebanon. He also organized a number of building projects that were to transform Babylon into one of the seven wonders of the ancient world. Among his noteworthy achievements were the construction of massive fortification walls around Babylon, the refurbishing of Marduk\'s temple in the city, and the building of huge palaces that served as the king\'s residences. Tales of these legendary achievements, as well as those of his father, Nabopolassar (626-605 B.C.), also found their way into the narratives of a number of Greek, Roman, and medieval historians and chronographers many centuries later. Unfortunately, much of the record of Nebuchadnezzar\'s achievements that was written in his own time has not survived. Instead, only secondary accounts of his military campaigns or his construction projects in Babylon written in Greek, Latin, Hebrew, or Arabic are available for analysis. These stories vary greatly in content and emphasis and, in many cases, distort much of what we know from Nebuchadnezzar\'s own sources. The Hebrews, for example, described Nebuchadnezzar\'s siege of Jerusalem in such a way as to consider it something that should never again be repeated. The Greeks, on the other hand, saw the building projects in Babylon as evidence of almost superhuman achievements, as monuments that were the result of efforts by a king who was almost godlike. Why, then, is there such diversity in the characterizations of Nebuchadnezzar? This book proposes answers to these questions.','1575910799','9781575910796',0,'Biography & Autobiography',0.00,202,'http://books.google.com/books/content?id=nxC1wF3_IEAC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(62,'Georgina i la Dragona','Không có tác giả','Không có nhà xuất bản','Không có ngày xuất bản','Không có mô tả','8448852656','9788448852658',0,'Comics & Graphic Novels',0.00,48,'https://via.placeholder.com/150','ca','NOT_MATURE','BOOK'),(63,'Escuela de dragones 3 - El secreto de la dragona del agua','Tracey West','MOLINO','2023-01-19','¿TE APUNTAS A LA ESCUELA DE DRAGONES? A Drake le encanta volar a lomos de su dragón y entrenar con sus amigos Rori, Bo y Ana, pero cuando alguien intenta robar la mágica Piedra de Dragón que les ayuda en sus aventuras, ¡el grupo de amigos deberá lanzarse a la acción! Aunque Bo ha empezado a comportarse de una forma muy rara... ¿Tendrá algún secreto? ¿Y estará relacionado con el misterioso ladrón? En esta serie encontrarás: - Historias dirigidas a lectores que empiezan a leer de manera independiente. - Textos sencillos, contenidos interesantes, tramas ágiles e ilustraciones en todas las páginas. - Narraciones ideales para estimular la confianza y la seguridad en sí mismos de los nuevos lectores.','8427232926','9788427232921',0,'Juvenile Fiction',0.00,95,'http://books.google.com/books/content?id=s2iXEAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800','es','NOT_MATURE','BOOK'),(64,'Emma. La petita dragona d\'Orient','Không có tác giả','Không có nhà xuất bản','Không có ngày xuất bản','Không có mô tả','8413034019','9788413034010',0,'Không có thể loại',0.00,0,'https://via.placeholder.com/150','ca','NOT_MATURE','BOOK'),(66,'Escuela de dragones 2 - El rescate de la dragona del sol','Tracey West','MOLINO','2022-09-08','¿TE APUNTAS A LA ESCUELA DE DRAGONES? Drake y sus amigos Ana, Rori y Bo entrenan dragones para el rey. Cuando Kepri, la dragona de Ana, enferma, deberán trabajar todos juntos para salvarla. ¿Fue la magia oscura lo que la hizo enfermar? ¿Tiene Lombriz un nuevo poder secreto que podría ayudarla? Los maestros de dragones están a punto de averiguarlo. En esta serie encontrarás: -Historias dirigidas a lectores que empiezan a leer de manera independiente. -Textos sencillos, contenidos interesantes, tramas ágiles e ilustraciones en todas las páginas. -Narraciones ideales para estimular la confianza y la seguridad en sí mismos de los nuevos lectores.','8427227760','9788427227767',0,'Juvenile Fiction',0.00,100,'http://books.google.com/books/content?id=Ohh1EAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800','es','NOT_MATURE','BOOK'),(68,'Valentina Y La Dragona / Valentina and the Dragon','Lucia Serrano','Beascoa','2019-06-25','¡Una nueva versión de la leyenda de Sant Jordi! Tenéis en vuestras manos una leyenda que ha permanecido en el olvido a lo largo de los tiempos: La verdadera historia de Valentina y la Dragona. Abrid bien vuestros ojos y oídos. Cerrad la boca, que no entren moscas. Y preparaos para conocer los detalles de cómo la terrible Dragona aterrorizó a un pueblo entero. Cómo estuvo a punto de merendarse al delicado y bello príncipe para saciar su hambre voraz. Y cómo Valentina, la más valiente entre las valientes, solucionó todo este desaguisado con arrojo, fiereza, y humor. Mucho humor. Porque tal vez las cosas no son como nos las habían contado. Y tal vez las rosas fueron blancas. O amarillas. ENGLISH DESCRIPTION A new version of the legend of Saint Jordi! You have in your hands a legend that has been forgotten over time: The true history of Valentina and the Dragon. Open your eyes and ears. Close your mouth or you\'ll just catch flies. And get ready to learn the details about how the terrible Dragon terrorized an entire town. How she was about to snack on the delicate, handsome prince to satisfy her voracious hunger. And how Valentina, the bravest of the brave, solved the entire situation with courage, ferocity, and humor. Lots of humor. Because maybe things didn\'t happen the way they told us they did. And maybe the roses were white. Or yellow.','8448852664','9788448852665',0,'Juvenile Fiction',0.00,48,'http://books.google.com/books/content?id=U35awgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api&fife=w800','es','NOT_MATURE','BOOK'),(72,'Dragon Ball','Akira Toriyama','Viz Media','2000','The quiet life of a young monkey-tailed boy named Goku is disrupted when he meets the boy-crazy Bulma, who is on a quest to collect seven Dragon Balls. If she succeeds, the Eternal Dragon will grant her one wish. Illustrations.','1569314950','9781569314951',2,'Comics & Graphic Novels',5.00,194,'http://books.google.com/books/content?id=3ZaknseaTG4C&printsec=frontcover&img=1&zoom=1&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(73,'Dragon Ball Z','Akira Toriyama','Viz Graphic Novels','2002','Gohan, Kuririn, and Bulma struggle to save their Dragon Balls from Captain Ginyu.','1569316988','9781569316986',1,'Comics & Graphic Novels',5.00,196,'http://books.google.com/books/content?id=Wu9QF8rm7WUC&printsec=frontcover&img=1&zoom=1&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(74,'Dragon Ball Super, Vol. 16','Akira Toriyama','VIZ Media LLC','2022-08-02','Granolah is the last of the Cerealians, a people who were all but wiped out by the Saiyans and Freeza’s army many years ago. When he learns that the long-lost twin to the Dragon Ball that the old Namekian Monaito keeps in their home has been found, Granolah steals it and makes a wish that will allow him to start his quest for revenge against the Saiyans—to become the strongest being in the whole universe! Meanwhile, the Heeters work behind the scenes to put Granolah out of his misery once and for all...by enlisting Goku and Vegeta’s help! -- VIZ Media','1974733572','9781974733576',0,'Comics & Graphic Novels',0.00,193,'http://books.google.com/books/content?id=IllJEAAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(75,'Dragon Soul','Derek Padula','Derek Padula','2015-06-02','With a foreword from Christopher Sabat and Sean Schemmel, Dragon Soul: 30 Years of Dragon Ball Fandom is a grand celebration of the world\'s greatest anime and manga and it\'s momentous 30th Anniversary. Join me on a global adventure in search of the 7 dragon balls, as we head west toward Japan, the birthplace of Dragon Ball. Along the way we\'ll meet 81 fans from 25 countries who will share their Dragon Ball story. From artists to authors, collectors to philosophers, we\'ll hear their Dragon Soul and discover how Dragon Ball changed their lives. Includes over 100 images. We\'ll meet such famous fans as Lawrence Simpson (MasakoX) from Team Four Star, Malik from Dragon Ball New Age, Salagir from Dragon Ball Multiverse, MMA fighter Marcus Brimage, YouTube celebrities SSJGoshin4, Nelson Junior (Casa do Kame), and film critic Chris Stuckmann, famous cosplayers \"Living Ichigo,\" Atara Collis, and Jah\'lon Escudero, the creators of Dragon Ball Z: Light of Hope, Twitter star @Goku, authors Patrick Galbraith, Nestor Rubio, and Vicente Ramirez, and dozens more. Joining us will be 27 professionals from 7 countries, including American voice actors Chris Sabat (Vegeta), Sean Schemmel (Goku), Chris Ayres (Freeza), Chris Rager (Mister Satan), Mike McFarland (Master Roshi), Chuck Huber (Android 17), Kyle Hebert (Son Gohan), Jason Douglas (Beerus), Chris Cason (Tenshinhan), FUNimation employees Justin Rojas, Adam Sheehan, and Rick Villa, Dragon Ball Z composer Bruce Faulconer, Dragon Ball manga editor Jason Thompson, Canadian voice actors Peter Kelamis (Goku) and Brian Drummond (Vegeta), Latin American voice actors Mario Castaneda (Goku), Rene Garcia (Vegeta), Eduardo Garza (Krillin), French voice actor Eric Legrand (Vegeta), French journalist Olivier Richard, Spanish voice actors Jose Antonio Gavira (Goku), Julia Oliva (Chichi), and manga editor David Hernando, Danish voice actors Caspar Philllipson (Goku) and Peter Secher Schmidt (Freeza), and Brazilian voice actor Wendel Bezerra (Goku). Gather your belongings, jump on your magic cloud, and embark on a grand adventure, in Dragon Soul: 30 Years of Dragon Ball Fandom!','1943149011','9781943149018',0,'Comics & Graphic Novels',0.00,816,'http://books.google.com/books/content?id=92nDCQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(76,'Dragon Ball Culture Volume 1','Derek Padula','Derek Padula','2014-12-21','See Dragon Ball with new eyes. This book is your cultural tour guide of Dragon Ball, the world’s most recognized anime and manga series. Over 11 years in development, at over 2,000 pages, and featuring over 1,800 unique terms, Dragon Ball Culture is a 7 Volume analysis of your favorite series. You will go on an adventure with Son Goku, from Chapter 1 to 194 of the original Dragon Ball series, as we explore every page, every panel, and every sentence, to reveal the hidden symbolism and deeper meaning of Dragon Ball. In Volume 1 you will discover the origin of Dragon Ball. How does Akira Toriyama get his big break and become a manga author? Why does he make Dragon Ball? Where does Dragon Ball’s culture come from? And why is it so successful? Along the way you’ll be informed, entertained, and inspired. You will learn more about your favorite series and about yourself. Now step with me through the doorway of Dragon Ball Culture.','0983120579','9780983120575',1,'Comics & Graphic Novels',5.00,248,'http://books.google.com/books/content?id=JYvmBQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(77,'Dragon Ball Culture Volume 6','Derek Padula','Derek Padula','2016-05-19','Goku meets god! In Dragon Ball Culture Volume 6, we’ll reunite with Goku as he ascends to heaven, trains with Kami for 3 years, and battles the reincarnated Demon King Pikkoro! When Goku reaches heaven he is greeted by the always-controversial Mister Popo. But who is Mister Popo, and why does he look so strange? His ancient cultural origin will finally be revealed! From there we’ll explore Kami’s roots in Japanese Shinto and Chinese Buddhism. You’ll discover how Kami and Pikkoro are related on a spiritual level, how reincarnation works within the Dragon World, and what it means for the new demon king to be the ‘son of the father who was cast down from heaven.’ Afterward, we’ll enter the 23rd Tenkaichi Budokai! But will Goku’s friends recognize him, and will he be strong enough to persevere?! Who is this green-skinned man who calls himself “Ma Junia,” and why is he such a grave threat to Goku and the world?! Discover the amazing truth behind these new characters, with surprising mystery’s and reveals from your old friends, as we take a cultural tour through the final volume of the original Dragon Ball manga! It’s a battle of life and death, and Goku’s the only one who can save us!! Volume 6 explores Chapters 162 to 194 of the Dragon Ball manga. It’s time to face god!','1943149070','9781943149070',0,'Comics & Graphic Novels',0.00,320,'http://books.google.com/books/content?id=UOgvDAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(78,'Dragon Ball, Vol. 8','Akira Toriyama','VIZ Media LLC','2003-07-08','Eath\'s greatest hero...is from outerspace! Dragon Ball introduces a young monkey-tailed boy named Goku (a wry update of the classic Chinese \"Monkey King\" legend), whose quiet life changes when he meets a girl named Bulma who is on a quest to collect seven \"Dragon Balls.\" If she gathers them all, an incredibly powerful dragon will appear and grant her one wish. But the precious orbs are scattered all over the world, and Bulma could use the help of a certain super-strong boy... (In Japan, Dragon Ball and Dragon Ball Z were originally a single 42-volume series. VIZ Media\'s Dragon Ball contains vols. 1-16 of the original Japanese Dragon Ball, from the beginning of the series to the climax of Goku\'s last fight with Piccolo.) Tired of losing their best operatives to Son Goku, the commanders of the Red Ribbon Army hire Taopaipai, the world\'s greatest assassin, to \"take care\" of him permanently! To have a chance of defeating this new opponent, Goku must climb the miles-high Karin Tower, where a mysterious hermit guards a jug of magic water which will grant the one who drinks it super strength. And while Goku struggles to get the magic water, time is running out...because Commander Red only needs two more Dragon Balls to make his deepest, darkest wishes come true!','1569319278','9781569319277',1,'Comics & Graphic Novels',3.00,194,'http://books.google.com/books/content?id=HFYjkib95zkC&printsec=frontcover&img=1&zoom=1&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(79,'Dragon Ball, Vol. 10','Akira Toriyama','VIZ Media LLC','2003-07-01','Eath\'s greatest hero...is from outerspace! Dragon Ball introduces a young monkey-tailed boy named Goku (a wry update of the classic Chinese \"Monkey King\" legend), whose quiet life changes when he meets a girl named Bulma who is on a quest to collect seven \"Dragon Balls.\" If she gathers them all, an incredibly powerful dragon will appear and grant her one wish. But the precious orbs are scattered all over the world, and Bulma could use the help of a certain super-strong boy... (In Japan, Dragon Ball and Dragon Ball Z were originally a single 42-volume series. VIZ Media\'s Dragon Ball contains vols. 1-16 of the original Japanese Dragon Ball, from the beginning of the series to the climax of Goku\'s last fight with Piccolo.) Goku needs just one more Dragon Ball to wish Upa\'s father back to life...but the Ball is in the hands of an old enemy! Then, Goku and his friends part ways, promising to meet again in three years at the Tenka\'ichi Budôkai, the \"Strongest-Under-the-Heavens\" Martial Arts Tournament. But this time the competition is stronger than ever: Tenshinhan and Chaozu, the deadly disciples of Tsuru-Sen\'nin, the Crane Hermit! Will Kame-Sen\'nin\'s turtle-style kung fu beat crane style? Or will their strange new opponents be triumphant?','1569319294','9781569319291',1,'Comics & Graphic Novels',3.00,196,'http://books.google.com/books/content?id=7EZpuenjnewC&printsec=frontcover&img=1&zoom=1&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(80,'Dragon Ball Culture Volume 2','Derek Padula','Derek Padula','2015-01-14','Son Goku\'s adventure begins! Join me in Dragon Ball Culture Volume 2, as we travel along with Goku on his epic journey for greater strength. With each step that Goku takes, you\'ll discover more of the hidden spirituality and symbolism in Dragon Ball that makes the series so successful. You\'ll see how author Akira Toriyama synthesizes Chinese culture, Western technology, and Buddho-Daoist philosophy to create a series that speaks to your humanity. Not because of the action or the humor, but because it reminds you of what it means to be alive. Along the way you\'ll learn of Goku\'s ancient origin. You\'ll hear how the legend of a wild monkey-man begins in India, evolves across 2,000 years of Chinese and Japanese history, and leads to the Goku you know and love. I\'ll walk you through the journey from the first page to the last. And by the time we\'re done, you will be an expert on Dragon Ball\'s culture. Volume 2 explores Chapters 1 to 23 of the Dragon Ball manga. So let\'s take our first step with Goku!','0983120544','9780983120544',0,'Comics & Graphic Novels',0.00,507,'http://books.google.com/books/content?id=uxcqBgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(81,'Dragon Ball Culture Volume 3','Derek Padula','Derek Padula','2015-02-06','Goku begins a new adventure, and this time the quest is to conquer thyself. In Dragon Ball Culture Volume 3: Battle, you’ll discover the origin of Goku’s training mentality. You’ll see how Akira Toriyama combines thousands of years of martial arts history and modern cinema together to create the Tenkaichi Budōkai. And you’ll hear how Dragon Ball almost gets cancelled, but then changes its format to become the world’s most recognized anime and manga series. Travel alongside Goku as he becomes the disciple of the world’s greatest martial artist, meets his new training partner, and competes in the largest tournament on Earth. Will this wild monkey boy gain the discipline he needs to become the champion? Volume 3 explores Chapters 24 to 53 of the Dragon Ball manga. Let the battle begin!','0983120501','9780983120506',0,'Comics & Graphic Novels',0.00,364,'http://books.google.com/books/content?id=RmqEBgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800','en','NOT_MATURE','BOOK'),(873,'Roblox Top Adventure Games','Official Roblox Books (HarperCollins)','HarperCollins','2018-10-30','From the Bloxy Award-winning Jailbreak and Lumber Tycoon 2 to the massively popular Heroes of Robloxia and Apocalypse Rising, this action-packed book gives you the official scoop on some of the most popular and critically acclaimed adventure games on Roblox. Each profile tells you everything you need to know, including a guide to gameplay, interviews with the creators, and tips and tricks to take your skills to the next level.','0062862677','9780062862679',4,'Juvenile Nonfiction',5.00,99,'http://books.google.com/books/content?id=x3tbDwAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(874,'X-Men','Mike Carey','Marvel Entertainment','2011-07-06','Collects Age of X Alpha, X-Men Legacy #245-247, New Mutants #22-24 & Age of X Universe #1-2. In a world where the X-Men never existed and mutantkind has been hunted to extinction, the few remaining mutants have banded together to make their last stand. What has led Magneto and these warped X-Men to these dire circumstances - and who can save them all?','0785179046','9780785179047',0,'Comics & Graphic Novels',0.00,269,'http://books.google.com/books/content?id=0ZBbJ-RHz9sC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(875,'Minecraft: The Village','Max Brooks','Random House','2024-10-01','The final book in Max Brooks’s official Minecraft trilogy! The New York Times bestselling author of Minecraft: The Island details the story of two stranded heroes whose block-breaking expedition lands them squarely in the middle of a conflict that only they can resolve. Journeying into the unknown is a scary prospect, but together Guy and Summer can navigate any challenge. The two castaways strike out in this curious, blocky world, searching for a way home. As they cross the Overworld—traversing frozen wastelands and scorching deserts—the pair makes an exciting discovery: a community populated by villagers! Guy and Summer settle in to learn more about their new friends, trading with the residents and exploring the surrounding area as they work out the next steps in their voyage. But with monstrous mobs and perilous pitfalls around every corner, they soon find that they might be needed here more than they’d thought. When a villager disappears, their investigation uncovers new foes—ones so powerful that this might spell the end of their adventure. Drawing on the lessons they’ve learned along the way, Guy and Summer must work together to protect the village.','0593159209','9780593159200',0,'Juvenile Fiction',2.00,353,'http://books.google.com/books/content?id=jK0NEQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(876,'Re:ZERO -Starting Life in Another World-, Chapter 2: A Week at the Mansion, Vol. 1 (manga)','Tappei Nagatsuki','Yen Press LLC','2017-05-23','What you forget, I\'ll always remember. Using his ability to repeat past events, a power named \"Return by Death,\" Subaru has saved the half-elf girl Emilia from a grim fate. However, his celebration is violently cut short. Subaru now wakes up in a large mansion, unsure of whether time has moved forward. Greeting him are the maid sisters Ram and Rem, whose verbal jabs sting with every word. It\'s a chance for a new life, but is Subaru in more danger than he realizes?','0316513199','9780316513197',0,'Comics & Graphic Novels',0.00,214,'http://books.google.com/books/content?id=y0zFDgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(877,'Re:ZERO -Starting Life in Another World-, Vol. 1 (light novel)','Tappei Nagatsuki','Hachette UK','2016-07-19','Subaru Natsuki was just trying to get to the convenience store but wound up summoned to another world. He encounters the usual things--life-threatening situations, silver haired beauties, cat fairies--you know, normal stuff. All that would be bad enough, but he\'s also gained the most inconvenient magical ability of all--time travel, but he\'s got to die to use it. How do you repay someone who saved your life when all you can do is die?','031639839X','9780316398398',0,'Fiction',2.00,250,'http://books.google.com/books/content?id=aJ0sDAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(878,'The Genetics of the Dog','Elaine A. Ostrander, Anatoly Ruvinsky','CABI','2012','Recognizing the significant advances made in the field of animal genetics in the ten years since the first edition of Genetics of the Dog, this new edition of the successful 2001 book provides a comprehensive update on the subject, along with new material on topics of current and growing interest. Existing chapters on essential topics such as immunogenetics, genetics of diseases, developmental genetics and the genetics of behaviour have been fully updated, while new authors report on the latest advances in areas such as genetic diversity of dog breeds, canine genomics, olfactory genetics and cancer genetics.','1845939409','9781845939403',1,'Medical',5.00,537,'http://books.google.com/books/content?id=C7OPzPEpkN0C&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(879,'The Book on the Bookshelf','Henry Petroski','Vintage','2010-12-01','From the author of the highly praised The Pencil and The Evolution of Useful Things comes another captivating history of the seemingly mundane: the book and its storage. Most of us take for granted that our books are vertical on our shelves with the spines facing out, but Henry Petroski, inveterately curious engineer, didn\'t. As a result, readers are guided along the astonishing evolution from papyrus scrolls boxed at Alexandria to upright books shelved at the Library of Congress. Unimpeachably researched, enviably written, and charmed with anecdotes from Seneca to Samuel Pepys to a nineteenth-century bibliophile who had to climb over his books to get into bed, The Book on the Bookshelf is indispensable for anyone who loves books.','0307773280','9780307773289',0,'Literary Criticism',0.00,308,'http://books.google.com/books/content?id=7ahpbLtmksgC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(880,'Vietnam','D.R. SarDesai','Routledge','2018-02-23','“An indispensable tool for college students and general readers, the only available text that treats Vietnamese history in its entirety, from its beginning to the twenty-first century, as it places Vietnam within the regional and global context. SarDesai’s Vietnam looks at Vietnam as a country and not just as a war. The text has also benefited from its author’s decades-long expertise on Southeast Asia as reflected in the comprehensive bibliography and use of the latest works.” —NGUYEN THI DIEU, Ph.D., Temple University','0429975198','9780429975196',0,'Political Science',0.00,245,'http://books.google.com/books/content?id=yJZNDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(881,'A History of Thailand','Christopher John Baker, Pasuk Phongpaichit','Cambridge University Press','2014-05-30','A History of Thailand offers a lively and accessible account of Thailand\'s political, economic, social and cultural history. This book explores how a world of mandarin nobles and unfree peasants was transformed and examines how the monarchy managed the foundation of a new nation-state at the turn of the twentieth century. The authors capture the clashes between various groups in their attempts to take control of the nation-state in the twentieth century. They track Thailand\'s economic changes through an economic boom, globalisation and the evolution of mass society. This edition sheds light on Thailand\'s recent political, social and economic developments, covering the coup of 2006, the violent street politics of May 2010, and the landmark election of 2011 and its aftermath. It shows how in Thailand today, the monarchy, the military, business and new mass movements are players in a complex conflict over the nature and future of the country\'s democracy.','1107420210','9781107420212',0,'History',0.00,345,'http://books.google.com/books/content?id=FDmNAwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(882,'The International Development of China','Sun Yat-sen','Library of Alexandria','1956-01-01','As soon as Armistice was declared in the recent World War, I began to take up the study of the International Development of China, and to form programs accordingly. I was prompted to do so by the desire to contribute my humble part in the realization of world peace. China, a country possessing a territory of 4,289,000 square miles, a population of 400,000,000 people, and the richest mineral and agricultural resources in the world, is now a prey of militaristic and capitalistic powers a greater bone of contention than the Balkan Peninsula. Unless the Chinese question can be settled peacefully, another world war greater and more terrible than the one just past will be inevitable. In order to solve the Chinese question, I suggest that the vast resources of China be developed internationally under a socialistic scheme, for the good of the world in general and the Chinese people in particular. It is my hope that as a result of this, the present spheres of influence can be abolished; the international commercial war can be done away with; the internecine capitalistic competition can be got rid of, and last, but not least, the class struggle between capital and labor can be avoided. Thus the root of war will be forever exterminated so far as China is concerned. Each part of the different programs in this International Scheme, is but a rough sketch or a general policy produced from a layman\'s thought with very limited materials at his disposal. So alterations and changes will have to be made after scientific investigation and detailed survey. For instance, in regard to the projected Great Northern Port, which is to be situated between the mouths of the Tsingho and the Lwanho, the writer thought that the entrance of the harbor should be at the eastern side of the port but from actual survey by technical engineers, it is found that the entrance of the harbor should be at the western side of the port instead. So I crave great indulgence on the part of experts and specialists.','1465544453','9781465544452',0,'Fiction',0.00,288,'http://books.google.com/books/content?id=J4YYNO6R3NAC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(883,'Play Together','Laura Haver','Hatherleigh Press','2023-08-29','Rediscover play with over 60 screen-free family activities and games that promote bonding, connection, and growth. Featuring over 60 games, Play Together is your go-to guide for family fun. Based on happiness, play, communication, and emotional intelligence research, the games and activities are more than just enjoyable. They also teach important life skills and catapult your family’s development in the following: Connection Creativity Mindfulness Kindness Movement and more Plus, they’re simple. You can play most games in five minutes using materials you already have on hand. Activities are categorized by type (see above) and include detailed instructions as well as tips, anecdotes and conversation prompts for families. Some of the games included are: Marble Mania Madness 3-2-1…Freeze! The What If? Imagination Game Cardboard Creations Snap-A-Letter Scavenger Hunt Make Your Own Puzzle DJ Art Floor Pong and more! Ever wish life (and parenting) was more fun? Stop wondering what to do with your kids and instead begin to play together. You’ll be amazed at the wonder these games open up in you and your family’s lives. Optimized for kids 12 and under and fun for people of all ages!','157826975X','9781578269754',0,'Family & Relationships',0.00,291,'http://books.google.com/books/content?id=Z-VxEAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(884,'How To Speak Dog','Stanley Coren','Simon and Schuster','2012-12-11','Communication is crucial in any relationship - especially when one of you happens to be a dog. Drawing on substantial research in animal behaviour, Stanley Coren demonstrates that the average house dog can distinguish at least 140 words and can interact at a level approaching that of a human two-year-old. While actual conversation of the sort Lassie seemed capable of in Hollywood myth-making remains in the realm of fantasy, this book shows us that a great deal of real communication is possible between humans and dogs beyond the simple giving and obeying of commands. How to Speak Dog not only explains the sounds, words, actions and movements which will help owners to communicate most effectively with their dogs; it also deciphers the signs and signals our dogs are giving to us. With easy-to-follow tips on how humans can mimic the language dogs use to talk to one another, original drawings illustrating the subleties of canine body language and a handy visual glossary, How to Speak Dog gives dog lovers a whole new range of essential skills with which to improve their relationship with their dogs.','1471109410','9781471109416',0,'Pets',0.00,499,'http://books.google.com/books/content?id=Yzb3K3PykREC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(885,'One Piece','Eiichiro Oda','VIZ Media LLC','2007-01-02','As a child, Monkey D. Luffy dreamed of becoming the King of the Pirates. But his life changed when he accidentally gained the power to stretch like rubber¿at the cost of never being able to swim again! Now Luffy, with the help of a motley collection of pirate wannabes, is setting off in search of the \"One Piece,\" said to be the greatest treasure in the world...','1421506653','9781421506654',0,'Comics & Graphic Novels',0.00,208,'http://books.google.com/books/content?id=mNKgtgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(886,'Dog Behaviour, Evolution, and Cognition','Ádám Miklósi','Không có nhà xuất bản','2015','This is the first book to collate and synthesize the recent burgeoning primary research literature on dog behaviour, evolution, and cognition. The author presents a new ecological approach to the understanding of dog behaviour, demonstrating how dogs can be the subject of rigorous and productive scientific study without the need to confine them to a laboratory environment. This second, fully updated edition of Dog Behaviour, Evolution and Cognition starts with an overview of the conceptual and methodological issues associated with the study of the dog, followed by a brief description of their role in human society. An evolutionary perspective is then introduced with a summary of current research into the process of domestication. The central part of the book is devoted to issues relating to the cognitive aspects of behaviour which have received particular attention in recent years from both psychologists and ethologists. The book\'s final chapters introduce the reader to many novel approaches to dog behaviour, set in the context of behavioural development and genetics. This second edition recognises and discusses the fact that dogs are increasingly being used as model organisms for studying aspects of human biology, such as genetic diseases and ageing. Specific attention is also given in this edition to attachment behaviour which emerges between humans and dogs, the importance of inter-specific communication in the success of dogs in human communities and the broad aspects of social cognition and how this may contribute to human-dog cooperation Directions for future research are highlighted throughout the text which also incorporates links to human and primate research by drawing on homologies and analogies in both evolution and behaviour. The book will therefore be of relevance and use to anyone with an interest in behavioural ecology including graduate students of animal behaviour and cognition, as well as a more general audience of dog enthusiasts, biologists, psychologists, veterinarians, and sociologists.','019964666X','9780199646661',0,'Pets',0.00,398,'http://books.google.com/books/content?id=VT-WBQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(887,'Minecraft For Dummies','Jesse Stay, Thomas Stay, Jacob Cordeiro','John Wiley & Sons','2015-01-20','Don\'t be a Minecraft tourist - get expert tips and advice in this full-color primerMinecraft For Dummies is the primer you need to get up to speed.','1118968239','9781118968239',0,'Computers',5.00,384,'http://books.google.com/books/content?id=jf_9BQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(888,'One piece','Eiichiro Oda','Không có nhà xuất bản','2016-12','Không có mô tả','8822603605','9788822603609',0,'Comics & Graphic Novels',0.00,192,'http://books.google.com/books/content?id=8wYwvgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api&fife=w800&format=webp','it','NOT_MATURE','BOOK'),(889,'Re:ZERO -Starting Life in Another World-, Vol. 3 (light novel)','Tappei Nagatsuki','Yen Press LLC','2017-03-21','--Let\'s get this story moving. Alongside the people most important to him, a boy goes out to meet the same sunrise once more. Strengthening his resolve, Subaru returns to his first day in the mansion. Repeating his loop in the Roswaal household armed with his memories, Subaru attempts to only make the optimal decisions to avoid another tragedy, but his fear and obsession with evading death and failure are slowly warping him. While Subaru slowly falls apart trying to save everyone...who will save Subaru...?','0316398411','9780316398411',0,'Fiction',0.00,250,'http://books.google.com/books/content?id=7Q4mDQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(890,'Minecraft: The Village','Max Brooks','Penguin Group','2024-10-03','Không có mô tả','180494713X','9781804947135',0,'Juvenile Fiction',0.00,0,'http://books.google.com/books/content?id=flHR0AEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(891,'Classroom Management','Lisa A. Bloom','Prentice Hall','2009','A brand new, comprehensive text for the field that takes a proactive, child-centered approach, Classroom Management: Creating Positive Classrooms for all Students walks teachers and pre-service teachers through a detailed, step-by-step plan that will enable them to develop their own personal and unique design for classroom management practices that they will enact in the classroom. Readers will be asked to examine their personal views and ambitions for classroom management, motivation and engagement; think about and develop their hopes and aspirations for the students that they will teach and the relationships and structures that they will build in order to attain their goals. Considering multiple perspectives, implementing and evaluating practices, the author provides the necessary needed to examine the full spectrum of classroom management practices including the student, family and cultural viewpoints, and understanding not only student needs but the teacher\'s own perceptions in the context of the school and the community. Furthermore readers will appreciate the special attention that is given to these topics related to classroom management: professional collaboration with regard to school and classroom climate, inclusion, education of diverse learners, preparing learners for living in a democratic society, evidence-based practices, motivation and engagement, classroom management practices that enhance academic achievement, current research and practices, the role of social interaction in learning and behavior, examples of Action Research in the classroom, culturally-responsive classroom management, peer mediation and conflict resolution, real-life examples, excerpts from interviews of children and adolescents, and quotes from classroom teachers. An excellent textbook choice for all undergraduate- and graduate-level courses in Classroom Management, also suitable for courses in Educational Psychology.',NULL,NULL,0,'Education',0.00,292,'http://books.google.com/books/content?id=pVBXAAAAYAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(892,'Life in Classrooms','Philip Wesley Jackson','Teachers College Press','Không có ngày xuất bản','Since its first appearance, Life in Classrooms has established itself as a classic study of the educational process at its most fundamental level.','0807770051','9780807770054',0,'Education',4.00,212,'http://books.google.com/books/content?id=W46Gu6wwYsQC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(893,'Planning Classroom Management','Karen Bosch','Corwin Press','2006-05-12','The author helps teachers develop classroom management plans through a five-step process that includes introspection, observation, plan development, implementation, and plan revision.','141293768X','9781412937689',0,'Education',3.00,177,'http://books.google.com/books/content?id=J66x352fH4MC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(894,'Focus on the Language Classroom','Dick Allwright, Kathleen M. Bailey','Cambridge University Press','1991-04-25','The authors set out to define the aims, principles and objectives of recent research into what exactly happens in the language classroom, to describe the findings of this work, and to relate these to teaching practice.','0521269091','9780521269094',0,'Education',4.00,276,'http://books.google.com/books/content?id=2oDhkXnHApQC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(895,'Classroom Management','Lisa A. Bloom','Prentice Hall','2009','A brand new, comprehensive text for the field that takes a proactive, child-centered approach, Classroom Management: Creating Positive Classrooms for all Students walks teachers and pre-service teachers through a detailed, step-by-step plan that will enable them to develop their own personal and unique design for classroom management practices that they will enact in the classroom. Readers will be asked to examine their personal views and ambitions for classroom management, motivation and engagement; think about and develop their hopes and aspirations for the students that they will teach and the relationships and structures that they will build in order to attain their goals. Considering multiple perspectives, implementing and evaluating practices, the author provides the necessary needed to examine the full spectrum of classroom management practices including the student, family and cultural viewpoints, and understanding not only student needs but the teacher\'s own perceptions in the context of the school and the community. Furthermore readers will appreciate the special attention that is given to these topics related to classroom management: professional collaboration with regard to school and classroom climate, inclusion, education of diverse learners, preparing learners for living in a democratic society, evidence-based practices, motivation and engagement, classroom management practices that enhance academic achievement, current research and practices, the role of social interaction in learning and behavior, examples of Action Research in the classroom, culturally-responsive classroom management, pe