ucation of diverse learners, preparing learners for living in a democratic society, evidence-based practices, motivation and engagement, classroom management practices that enhance academic achievement, current research and practices, the role of social interaction in learning and behavior, examples of Action Research in the classroom, culturally-responsive classroom management, peer mediation and conflict resolution, real-life examples, excerpts from interviews of children and adolescents, and quotes from classroom teachers. An excellent textbook choice for all undergraduate- and graduate-level courses in Classroom Management, also suitable for courses in Educational Psychology.',NULL,NULL,0,'Education',0.00,292,'http://books.google.com/books/content?id=pVBXAAAAYAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(898,'Coding with Minecraft','Al Sweigart','No Starch Press','2018-05-29','A hands-on introduction to coding that teaches you how to program bots to do cool things in the game you love--Minecraft! This book takes the robotic \"turtle\" method, and extends it to the 3D, interactive world of Minecraft. You\'ve mined for diamonds, crafted dozens of tools, and built all sorts of structures--but what if you could program robots to do all of that for you in a fraction of the time? In Coding with Minecraft®, you\'ll create a virtual robot army with Lua, a programming language used by professional game developers. Step-by-step coding projects will show you how to write programs that automatically dig mines, collect materials, craft items, and build anything that you can imagine. Along the way, you\'ll explore key computer science concepts like data types, functions, variables, and more. Learn how to: - Program robots that make smart decisions with flow control - Reuse code so that your robots can farm any crop you want, including wheat, sugar cane, and even cacti! - Program a factory that generates infinite building supplies - Design an algorithm for creating walls and buildings of any size - Code yourself a pickaxe-swinging robotic lumberjack! - Create a robot that digs mine shafts with stairs so you can explore safely Bonus activities in each chapter will help you take your coding skills to the next level. By the end of the book, you\'ll understand how powerful coding can be and have plenty of robots at your beck and call.','1593278535','9781593278533',0,'Computers',4.00,258,'http://books.google.com/books/content?id=LVv6DwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(899,'Colorful','Eto Mori','Catapult','2021-07-20','A beloved and bestselling classic in Japan, this groundbreaking tale of a dead soul who gets a second chance is perfect for readers of The Midnight Library. \"Congratulations, you\'ve won the lottery!\" shouts the angel Prapura to a formless soul. The soul hasn\'t been kicked out of the cycle of rebirth just yet—he\'s been given a second chance. He must recall the biggest mistake of his past life while on \'homestay\' in the body of fourteen-year-old Makoto Kobayashi, who has just committed suicide. It looks like Makoto doesn\'t have a single friend, and his family don\'t seem to care about him at all. But as the soul begins to live Makoto\'s life on his own terms, he grows closer to the family and the people around him, and sees their true colors more clearly, shedding light on Makoto\'s misunderstandings. Since its initial release over twenty years ago, Colorful has become a part of the literary canon, not only in Japan—where it has sold over a million copies—but around the world, having been translated into several different languages. Now, Eto Mori\'s beloved classic is finally available in English.','1640094431','9781640094437',0,'Fiction',5.00,132,'http://books.google.com/books/content?id=P6UQEAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(900,'Minecraft - True or False?','G Whiz','GWhizBooks.com','2014-07-16','Are you a fan of Minecraft by Markus Persson and Jens Bergensten? Would you like to have hours of entertainment and enjoyment about the book you love? If you\'ve answered yes to any question above, get ready for a hip-new series that bring you FUN and EDUCATION at the same time! Gather around with family and friends and challenge one another with a series of questions ranging from easy to difficult levels and see who wins! Submit your Quiz Game scores via Google Forms for a chance to be ranked on \'G whiz Spotlights\' and hop on the Wall of Contributors! It\'s safe and fun for the whole family! \"Acts as an incredible reading guide. Helps to know not only about the books but the authors as well.\" - Marilin A. “Get ready for fun, down-to-earth, and amazing facts that keep you laughing & learning!\" Tips & Tricks to Enhance Reading Experience • Enter \"G Whiz\" after your favorite title to see if publication exists! ie) Minecraft G Whiz • Enter \"G Whiz 101\" to search for entire catalogue! • Collect Stars redeemable for books with every correct answer! • Participate in priority events by joining \"G Whiz Crew\"! • Submit a review for G Whiz trilogy sets and hop on the Wall of Contributors! This work is a derivative work not to be confused with the original title. It is a collection of facts from reputable sources generally known to the public with source URLs for further reading. It is unofficial and unaffiliated with respective parties of the original title in any way. Due to the nature of research, no content shall be deemed authoritative nor be used for citation purposes. Refined and tested for quality, we provide a 100% satisfaction guarantee or your money back.','1501443259','9781501443251',0,'Không có thể loại',4.00,34,'http://books.google.com/books/content?id=rlkGBAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(901,'Chuộc tội','Kanae Minato','Nha Nam - Ha Noi','2019','Vietnamese edition of a Japanese detective mystery thriller. Vietnamese translation by Vuong Hai Yen.','6045544579','9786045544570',0,'Detective and mystery stories',5.00,281,'http://books.google.com/books/content?id=jRJozQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api&fife=w800&format=webp','vi','NOT_MATURE','BOOK'),(902,'Confessions','Kanae Minato','Hachette UK','2014-08-19','Her pupils murdered her daughter. Now she will have her revenge. After calling off her engagement in the wake of a tragic revelation, Yuko Moriguchi had nothing to live for except her only child, four-year-old child, Manami. Now, following an accident on the grounds of the middle school where she teaches, Yuko has given up and tendered her resignation. But first she has one last lecture to deliver. She tells a story that upends everything her students ever thought they knew about two of their peers, and sets in motion a diabolical plot for revenge. Narrated in alternating voices, with twists you\'ll never see coming, Confessions probes the limits of punishment, despair, and tragic love, culminating in a harrowing confrontation between teacher and student that will place the occupants of an entire school in danger. You\'ll never look at a classroom the same way again.','0316200913','9780316200912',0,'Fiction',5.00,240,'http://books.google.com/books/content?id=wX4tBAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(903,'Digital Engineering with Minecraft','James Floyd Kelly','Que Publishing','2015-09-19','Digital Engineering with Minecraft Create amazing objects for Minecraft—and learn valuable real-world 3D design skills! Transform yourself into a Minecraft “engineer!” Discover how to create great Minecraft objects and structures fast, and push your creative skills to the max. You’ll have a blast, but that’s not all! You’ll learn how to use powerful 3D digital design and CAD tools—the same kinds of tools professionals use to earn big money in the “real” world! Best-selling tech author James Floyd Kelly covers all you’ll need to know, starting nearly every chapter with an amazing project. Kelly guides you through each step of designing your objects outside Minecraft, and then importing them to your game, where they can come to life! You’ll master powerful techniques using Tinkercad, 123D Creature, 123D Catch, 123D Sculpt, MCEdit, i-funbox, Online-Convert, and more. Think you can’t create incredible Minecraft stuff like this? Using Digital Engineering with Minecraft’s crystal-clear, step-by-step instructions and full-color photos, you can! Find great 3D objects on Thingiverse and import them to Minecraft with MCEdit Create hidden “secret entrances” with maze makers and Online-Convert Master key Tinkercad skills, including shape creation, rotation, resizing, and grouping Create and export monsters with 123D Creature Put yourself in the game with 123D Catch: stitch your selfies into a complete 3D model Generate rollercoasters and other landscapes in 123D Sculpt—without slow block-by-block in-game editing Create hollow wireframe domes to transform any terrain into a battle arena View your Minecraft worlds in 3D using a simple technique James Floyd Kelly is an avid maker, tinkerer, CAD expert and teacher. He excels at taking complex technology and finding a way to demystify it for non-technical readers. Kelly has written more than 25 guides to a wide variety of technical subjects, including Open Source software, LEGO robotics, 3D printing, and game programming. His recent books include Ultimate iPad and 3D Printing. He has degrees in both industrial engineering and English. Minecraft is a trademark of Mojang Synergies / Notch Development AB. This book is not affiliated with or sponsored by Mojang Synergies / Notch Development AB.','0134213289','9780134213286',0,'Games & Activities',0.00,503,'http://books.google.com/books/content?id=u3iUCgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','NOT_MATURE','BOOK'),(904,'The Hentai Prince And The Stony Cat Vol. 2','Sou Sagara','Digital Manga, Inc.','2014-05-16','Yoto is still suffering the consequences of having his façade stolen by a mysterious stony cat! Too bad he needs to figure out his feelings for not one but two charming ladies. Will Yoto step up and become a self-assured man of action…or will he fumble his way into deep embarrassment? The Hentai Prince and the Stony Cat mixes up incredible magic, sweet mischief and one mildly pervy guy to create a purrfectly playful adventure! When a special someone’s emotions are at stake, is it best to bite your tongue…or let loose with the heartfelt truth?','1613137028','9781613137024',0,'Comics & Graphic Novels',5.00,164,'http://books.google.com/books/content?id=bGQREAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api&fife=w800&format=webp','en','MATURE','BOOK');
